import { useNavigate } from 'react-router-dom';
import defaultProfileImage from '../assets/default-profile.jpg';

const ProfileCard = ({ profile }) => {
  const navigate = useNavigate();

  const handleImageError = (e) => {
    e.target.onerror = null;
    e.target.src = defaultProfileImage;
  };

  return (
    <div className="profile-card" onClick={() => navigate(`/profile/${profile.id}`)}>
      <div className="profile-card-header">
        <img
          src={profile.profilePhoto || defaultProfileImage}
          alt={profile.name}
          onError={handleImageError}
        />
      </div>
      <div className="profile-card-body">
        <h3>{profile.name}</h3>
        <p className="bio">{profile.bio}</p>
        <div className="skills">
          {profile.skills && profile.skills.slice(0, 3).map((skill, index) => (
            <span key={index} className="skill-tag">
              {skill.name}
            </span>
          ))}
          {profile.skills && profile.skills.length > 3 && (
            <span className="skill-tag more">+{profile.skills.length - 3} more</span>
          )}
        </div>
      </div>
    </div>
  );
};

export default ProfileCard;
